

CREATE TABLE `mas_activity` (
  `id` bigint(14) NOT NULL,
  `company_id` bigint(14) NOT NULL,
  `activity` varchar(200) NOT NULL,
  `status` int(1) NOT NULL,
  `create_user` varchar(200) NOT NULL,
  `create_date` datetime NOT NULL,
  `modify_user` varchar(200) NOT NULL,
  `modify_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `mas_company` (
  `id` bigint(14) NOT NULL,
  `company_name` varchar(255) NOT NULL,
  `status` int(1) NOT NULL,
  `create_user` varchar(100) NOT NULL,
  `create_date` datetime NOT NULL,
  `modify_user` varchar(200) NOT NULL,
  `modify_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `mas_department` (
  `id` bigint(14) NOT NULL,
  `company_id` bigint(14) NOT NULL,
  `department` varchar(200) NOT NULL,
  `status` int(1) NOT NULL,
  `create_user` varchar(30) NOT NULL,
  `create_date` datetime NOT NULL,
  `modify_user` varchar(200) NOT NULL,
  `modify_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `mas_legislation` (
  `id` bigint(14) NOT NULL,
  `company_id` bigint(14) NOT NULL,
  `department_id` bigint(14) NOT NULL,
  `legislation` varchar(200) NOT NULL,
  `short_legislation` varchar(100) NOT NULL,
  `status` int(1) NOT NULL,
  `create_user` varchar(30) NOT NULL,
  `create_date` datetime NOT NULL,
  `modify_user` varchar(200) NOT NULL,
  `modify_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `mas_location` (
  `id` bigint(14) NOT NULL,
  `company_id` bigint(14) NOT NULL,
  `location` longtext NOT NULL,
  `status` int(1) NOT NULL,
  `create_user` varchar(30) NOT NULL,
  `create_date` datetime NOT NULL,
  `modify_user` varchar(200) NOT NULL,
  `modify_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `mas_mode` (
  `id` bigint(14) NOT NULL,
  `company_id` bigint(14) NOT NULL,
  `mode` varchar(200) NOT NULL,
  `status` int(1) NOT NULL,
  `create_user` varchar(200) NOT NULL,
  `create_date` datetime NOT NULL,
  `modify_user` varchar(200) NOT NULL,
  `modify_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `mas_purpose` (
  `id` bigint(14) NOT NULL,
  `company_id` bigint(14) NOT NULL,
  `purpose` varchar(255) NOT NULL,
  `status` int(1) NOT NULL,
  `create_user` varchar(30) NOT NULL,
  `create_date` datetime NOT NULL,
  `modify_user` varchar(200) NOT NULL,
  `modify_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `mas_role` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `role_name` varchar(50) NOT NULL,
  `status` int(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;




CREATE TABLE `mem_reporting_officer` (
  `id` bigint(20) NOT NULL,
  `user_name` varchar(50) NOT NULL,
  `first_officer` varchar(30) NOT NULL,
  `second_officer` varchar(200) DEFAULT NULL,
  `third_officer` varchar(200) DEFAULT NULL,
  `update_status` int(1) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`user_name`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `member_login_access` (
  `id` bigint(14) NOT NULL,
  `username` varchar(30) NOT NULL,
  `password` varchar(50) NOT NULL,
  `active_status` int(1) NOT NULL,
  `role` int(1) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_name` (`username`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `member_registration` (
  `id` bigint(14) NOT NULL,
  `user_name` varchar(30) NOT NULL,
  `mem_name` varchar(200) NOT NULL,
  `email` varchar(100) DEFAULT NULL,
  `mobile` bigint(10) DEFAULT NULL,
  `location` bigint(14) DEFAULT NULL,
  `department` bigint(14) DEFAULT NULL,
  `designation` varchar(200) DEFAULT NULL,
  `company_id` bigint(14) NOT NULL,
  `update_status` int(1) NOT NULL,
  `create_user` varchar(200) NOT NULL,
  `create_date` datetime NOT NULL,
  `modify_user` varchar(200) NOT NULL,
  `modify_date` datetime NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_name` (`user_name`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `mng_cmp` (
  `id` bigint(14) NOT NULL,
  `mng_id` varchar(50) NOT NULL,
  `username` varchar(30) NOT NULL,
  `department_id` bigint(14) NOT NULL,
  `description` varchar(255) NOT NULL,
  `due_date` date NOT NULL,
  `renewed_date` date DEFAULT NULL,
  `purpose_value` double(14,2) NOT NULL,
  `budgeted_cost` double(14,2) DEFAULT NULL,
  `actual_transaction_value` double(14,2) DEFAULT NULL,
  `reference` varchar(255) DEFAULT NULL,
  `comp_nature` varchar(255) NOT NULL,
  `policy_document_no` varchar(255) NOT NULL,
  `assign_user` varchar(30) NOT NULL,
  `remarks` varchar(255) NOT NULL,
  `location_id` bigint(14) NOT NULL,
  `company_id` bigint(14) NOT NULL,
  `status` int(1) NOT NULL,
  `update_status` int(1) NOT NULL,
  `create_date` date NOT NULL,
  `modify_date` date DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `mng_id` (`mng_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;




CREATE TABLE `mng_cmp_bkup` (
  `id` bigint(14) NOT NULL,
