CREATE TABLE `ticket` (
  `id` bigint(14) NOT NULL,
  `ticket_id` varchar(255) NOT NULL,
  `ticket_subject` varchar(255) NOT NULL,
  `ticket_type` varchar(255) NOT NULL,
  `ticket_description` longtext NOT NULL,
  `ticket_user` varchar(100) NOT NULL,
  `ticket_user_company` bigint(14) NOT NULL,
  `ticket_date` datetime NOT NULL,
  `ticket_closed_date` datetime DEFAULT NULL,
  `status` int(1) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `ticket_id` (`ticket_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `upl_master` (
  `master_desc` varchar(200) NOT NULL,
