CREATE TABLE `upload_document_files` (
  `id` bigint(14) NOT NULL,
  `non_stat_stat_id` bigint(14) NOT NULL,
  `compliance_type` varchar(3) NOT NULL,
  `file_data` longtext NOT NULL,
